 *      https://leetcode.cn/problems/array-nesting/
 *      索引从0开始长度为N的数组A，包含0到N - 1的所有整数。找到最大的集合S并返回其大小，其中 S[i] = {A[i], A[A[i]], A[A[A[i]]], ... }且遵守以下的规则。
 *      假设选择索引为i的元素A[i]为S的第一个元素，S的下一个元素应该是A[A[i]]，之后是A[A[A[i]]]... 以此类推，不断添加直到S出现重复的元素。
 */

class Solution
{

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function arrayNesting($nums)
    {
        $max_count = 0;
        $l = count($nums);
        for ($i = 0; $i < $l; $i++) {
            $count = 0;
            $x = $i;
            while ($nums[$x] != -1) {
                $count++;
                $v = $nums[$x];
                $nums[$x] = -1;
                $x = $v;
            }
            $max_count = max($max_count, $count);
        }
        return $max_count;
    }

    //纯暴力超时
    function arrayNesting2($nums)
    {
        $max_count = 0;
        $l = count($nums);
        for ($i = 0; $i < $l; $i++) {
            $count = $this->get($nums, $i);
            $max_count = max($max_count, $count);
        }
        return $max_count;
    }

    function get(&$nums, $i)
    {
        $count = 1;
        $x = $i;
        while ($nums[$x] != $i) {
            $count++;
            $x = $nums[$x];
        }
//        echo "$i: $count\n";
        return $count;
    }
}

